package com.example.sedes.Account;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class Account {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private int id;    private String username;    private String email;    private String password;    private String roles;}